const data = {
  // fontWeightMedium: 600,
  // fontWeightBold: 800,
  h4: {
    fontSize: "1.5rem",
    fontWeight: 500,
  },
  h5: {
    fontSize: "1.25rem",
    fontWeight: 500,
  },
  h6: {
    fontSize: "1.05rem",
    fontWeight: 500,
  },
  fontFamily: [
    "Nunito",
    "Roboto",
    '"Helvetica Neue"',
    "Arial",
    "sans-serif",
  ].join(","),
};

export default data;
